import styled from "styled-components";

export const Tela = styled.div`
    width: 500px;
    height: 320px;
    background-color:#E8E8E8;
    border:1px solid black;
    display: flex;
    flex-direction: column;
    .d1{
        flex:1;
        display: flex;
    }
    .oculto{
        display: none;
    }
    .d1-1,.d1-2,.d1-3{
        height: 50px;
        display: flex;
        align-items: center;
       
    }
    .d1-2{
        justify-content: center;
        font-size: 25px;
    }
    .d1-4{
        flex:1;
        line-height: 2;
    }
    .d1-left{
        flex:1;
        display: flex;
        flex-direction: column;
        padding-left: 20px;
    }
    
    .voto-branco{
        flex:1;
        display: flex;
        flex-direction: column;
    }

    .voto-branco>.d1-3{
        font-size:45px;
        margin-top:5vh;
        justify-content: center;
    }
    .d1-right{
        width: 105px;
        display: flex;
        flex-direction: column;
        align-items: center;
        justify-content: center;
        font-size: 16px;
    }
    .d1-right>.small{
        width: 60%;
    }
    .d1-right>.normal{
        width: 85%;
    }
    .d2{
        height: 50px;
        font-size: 14px;
        border-top: 2px solid black;
        padding-left: 10px;
    }
    
    `
